import PropTypes from "prop-types";


function Button({text}) {
    return (
    <button 
        style={{
            backgroundColor: "tomato",
            color: "white",
        }}
    >
        {text}
    </button>
    );
}

Button.propTypes = {
    text: PropTypes.string.isRequired,
};


export default Button; // App.js에서 Button을 가져올 수 있게 한다.
